unit.typedef:
typedef struct
{
const int16_t *table;
date_t end_date;
} decoder_sys_t;

unit.decl_stmt:
static const uint16_t pi_channels_maps[] =
{
0,
AOUT_CHAN_CENTER, AOUT_CHANS_2_0, AOUT_CHANS_3_0,
AOUT_CHANS_4_0, AOUT_CHANS_5_0, AOUT_CHANS_5_1,
AOUT_CHANS_7_0, AOUT_CHANS_7_1, AOUT_CHANS_8_1,
};

function.block:
{
decoder_t *p_dec = (decoder_t*)p_this;
const int16_t *table;

switch( p_dec->fmt_in.i_codec )
{
case VLC_CODEC_ALAW:
table = alawtos16;
break;
case VLC_CODEC_MULAW:
table = ulawtos16;
break;
default:
return VLC_EGENERIC;
}

if( p_dec->fmt_in.audio.i_channels == 0 ||
p_dec->fmt_in.audio.i_channels > AOUT_CHAN_MAX )
{
msg_Err( p_dec, "bad channels count (1-%i): %i",
AOUT_CHAN_MAX, p_dec->fmt_in.audio.i_channels );
return VLC_EGENERIC;
}

if( p_dec->fmt_in.audio.i_rate == 0 )
{
msg_Err( p_dec, "bad samplerate: %d Hz", p_dec->fmt_in.audio.i_rate );
return VLC_EGENERIC;
}

msg_Dbg( p_dec, "samplerate:%dHz channels:%d",
p_dec->fmt_in.audio.i_rate, p_dec->fmt_in.audio.i_channels );



decoder_sys_t *p_sys = malloc(sizeof(*p_sys));
if( unlikely(p_sys == NULL) )
return VLC_ENOMEM;


p_dec->pf_decode = DecodeBlock;
p_dec->pf_flush = Flush;
p_dec->p_sys = p_sys;

p_dec->fmt_out.i_codec = VLC_CODEC_S16N;
p_dec->fmt_out.audio.i_format = VLC_CODEC_S16N;
p_dec->fmt_out.audio.i_rate = p_dec->fmt_in.audio.i_rate;
if( p_dec->fmt_in.audio.i_physical_channels )
p_dec->fmt_out.audio.i_physical_channels =
p_dec->fmt_in.audio.i_physical_channels;
else
p_dec->fmt_out.audio.i_physical_channels =
pi_channels_maps[p_dec->fmt_in.audio.i_channels];
aout_FormatPrepare( &p_dec->fmt_out.audio );

p_sys->table = table;

date_Init( &p_sys->end_date, p_dec->fmt_out.audio.i_rate, 1 );

return VLC_SUCCESS;
}

{
decoder_sys_t *p_sys = p_dec->p_sys;

if( p_block == NULL ) 
return VLCDEC_SUCCESS;

if( p_block->i_flags & (BLOCK_FLAG_CORRUPTED|BLOCK_FLAG_DISCONTINUITY) )
{
Flush( p_dec );
if( p_block->i_flags & BLOCK_FLAG_CORRUPTED )
{
block_Release( p_block );
return VLCDEC_SUCCESS;
}
}

if( p_block->i_pts != VLC_TICK_INVALID &&
p_block->i_pts != date_Get( &p_sys->end_date ) )
{
date_Set( &p_sys->end_date, p_block->i_pts );
}
else if( date_Get( &p_sys->end_date ) == VLC_TICK_INVALID )
{

block_Release( p_block );
return VLCDEC_SUCCESS;
}


p_block->i_pts = VLC_TICK_INVALID;

unsigned samples = p_block->i_buffer / p_dec->fmt_in.audio.i_channels;
if( samples == 0 )
{
block_Release( p_block );
return VLCDEC_SUCCESS;
}

if( decoder_UpdateAudioFormat( p_dec ) )
{
block_Release( p_block );
return VLCDEC_SUCCESS;
}
block_t *p_out = decoder_NewAudioBuffer( p_dec, samples );
if( p_out == NULL )
{
block_Release( p_block );
return VLCDEC_SUCCESS;
}

assert( p_out->i_nb_samples == samples );
assert( p_out->i_buffer == samples * 2 * p_dec->fmt_in.audio.i_channels );

p_out->i_pts = date_Get( &p_sys->end_date );
p_out->i_length = date_Increment( &p_sys->end_date, samples )
- p_out->i_pts;

const uint8_t *src = p_block->p_buffer;
int16_t *dst = (int16_t *)p_out->p_buffer;

samples *= p_dec->fmt_in.audio.i_channels;

for( unsigned i = 0; i < samples; i++ )
*(dst++) = p_sys->table[*(src++)];

block_Release( p_block );
decoder_QueueAudio( p_dec, p_out );
return VLCDEC_SUCCESS;
}

{
encoder_t *p_enc = (encoder_t *)p_this;

if( p_enc->fmt_out.i_codec != VLC_CODEC_ALAW
&& p_enc->fmt_out.i_codec != VLC_CODEC_MULAW )
return VLC_EGENERIC;

p_enc->fmt_in.i_codec = VLC_CODEC_S16N;
p_enc->fmt_in.audio.i_bitspersample = 16;
p_enc->fmt_out.audio.i_bitspersample = 8;
p_enc->fmt_out.i_bitrate = 8 * p_enc->fmt_in.audio.i_channels
* p_enc->fmt_in.audio.i_rate;
p_enc->pf_encode_audio = EncoderEncode;

msg_Dbg( p_enc, "samplerate:%dHz channels:%d",
p_enc->fmt_out.audio.i_rate, p_enc->fmt_out.audio.i_channels );
return VLC_SUCCESS;
}

{
if( !p_aout_buf || !p_aout_buf->i_buffer ) return NULL;

block_t *p_block = block_Alloc( p_aout_buf->i_buffer / 2 );
if( unlikely(p_block == NULL ) )
return NULL;

const int16_t *src = (int16_t *)p_aout_buf->p_buffer; 
int8_t *dst = (int8_t *)p_block->p_buffer; 

if( p_enc->fmt_out.i_codec == VLC_CODEC_ALAW )
{
for( unsigned i = 0; i < p_aout_buf->i_buffer / 2; i++ )
{
int16_t s = *(src++);
if( s >= 0)
*(dst++) = alaw_encode[s / 16];
else
*(dst++) = 0x7F & alaw_encode[s / -16];
}
}
else 
{
for( unsigned i = 0; i < p_aout_buf->i_buffer / 2; i++ )
{
int16_t s = *(src++);
if( s >= 0)
*(dst++) = ulaw_encode[s / 4];
else
*(dst++) = 0x7F & ulaw_encode[s / -4];
}
}

p_block->i_dts = p_block->i_pts = p_aout_buf->i_pts;
p_block->i_length = vlc_tick_from_samples(p_aout_buf->i_nb_samples,
p_enc->fmt_in.audio.i_rate);
return p_block;
}
